import React, { Component } from 'react'

class Admin extends Component {
  render() {
    return (
      <div>
        <button>Manage Employee</button>
          {/* this will be doing adding, removing, viewing Employees  */}
        <button>Manage Client</button>
        {/*  this will be doing adding, removing, viewing clients */}
        <button>Manage Project</button>
        {/* this will be doing pending changes, status, changeing or viewing projects */}
        <button>Logout</button>
      </div>
    )
  }
}

export default Admin
